  // return Stats, CountrySelector components
  return (
    <>
      <GlobalStyle/>
      <Wrapper>
      <p>SOS Alert</p>
      <h1>Coronavirus disease (COVID-19)</h1>
    </Wrapper>
      <div>
        <Stats url='https://covid19.mathdro.id/api/'></Stats>
        <CountrySelector></CountrySelector>
      </div>
    </>
  )
}


const Header = styled.div`
background-color: red;
padding: 20px;
color: white;
`
